import React, { useEffect } from 'react';

const startStreamlitServer = async () => {
    try {
        const response = await fetch('http://localhost:3001/start-streamlit', {
            method: 'POST',
        });
        const data = await response.text();
        console.log(data);
    } catch (error) {
        console.error('Error starting Streamlit server:', error);
    }
};

const ConfigurationAnalysis = () => {
    useEffect(() => {
        startStreamlitServer();
    }, []);

    return (
        <div style={{ position: 'fixed', top: 0, left: 0, width: '100%', height: '100vh' }}>
            <iframe
                src="http://localhost:8501"
                width="100%"
                height="100%"
                frameBorder="0"
                title="Configuration Analysis"
                style={{ border: 'none' }}
            ></iframe>
        </div>
    );
};

export default ConfigurationAnalysis;
